const Awards = (props) => {
    //Award generation
    var awardArray = props.tools.split(',');
    var awards = [];
    for (var i=0; i<awardArray.length; i++){
        var pointsArray = awardArray[i].split('-');
        awards.push(<p>{awardArray[0]}</p>);
        for (var j=0; j<pointsArray.length; j++){
            if (j!=0){
                awards.push(<p style={{paddingLeft:'12px'}}>{awardArray[j]}</p>);
            }
        }
    }

    return (
    <>
    {awards}
    </>
    )
}

export default Awards
